    return (
        <HeroContainer>

            <HeroContent>
                <HeroH1>Terms Of Use</HeroH1>
                <FaqH1>Last updated: 01/01/2021</FaqH1>
                <FaqH1>1. Introduction</FaqH1>
                <FaqP> Welcome to Swym Pools LLC (“Company”, “we”, “our”, “us”)! As you have just clicked our Terms of Service, please pause, grab a cup of coffee and carefully read the following pages. It will take you approximately 20 minutes. These Terms of Service (“Terms”, “Terms of Service”) govern your use of our mobile application Swym Pools operated by Swym Pools LLC. Our Privacy Policy also governs your use of the Swym savings application (“Service”) and explains how we collect, safeguard and disclose information that results from your use of our web pages. Please read it here http://www.swympools.org/privacy. Your agreement with us includes these Terms and our Privacy Policy (“Agreements”). You acknowledge that you have read and understood Agreements, and agree to be bound to them. If you do not agree with (or cannot comply with) Agreements, then you may not use the Service, but please let us know by emailing at support@swympools.org so we can try to find a solution. These Terms apply to all visitors, users and others who wish to access or use Service. Thank you for being responsible.</FaqP>
                <FaqH1>2. Communications</FaqH1>
                <FaqH1>3. Contests, Sweepstakes and Promotions</FaqH1>
                <FaqH1>4. Content</FaqH1>
                <FaqH1>5. Prohibited Uses</FaqH1>
                <FaqH1>6. Analytics</FaqH1>
                <FaqH1>7. No Use by Minors</FaqH1>
                <FaqH1>8. Accounts</FaqH1>
                <FaqH1>9. Intellectual Property</FaqH1>
                <FaqH1>10. Copyright Policy</FaqH1>
                <FaqH1>11. DMCA Notice and Procedure for Copyright Infringement Claims</FaqH1>
                <FaqH1>12. Error Reporting and Feedback</FaqH1>
                <FaqH1>13. Links To Other Web Sites</FaqH1>
                <FaqH1>14. Disclaimer Of Warranty</FaqH1>
                <FaqH1>15. Limitation Of Liability</FaqH1>
                <FaqH1>16. Termination</FaqH1>
                <FaqH1>17. Governing Law</FaqH1>
                <FaqH1>18. Changes to Services</FaqH1>
                <FaqH1>19. Amendments To Terms</FaqH1>
                <FaqH1>20. Waiver And Severability</FaqH1>
                <FaqH1>21. Acknowledgement</FaqH1>
                <FaqH1>22. Contact Us </FaqH1>

            </HeroContent>
        </HeroContainer>
    )
}

export default TermsSection
